import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Head.css';
const Head = () => {
    const navigate = useNavigate();
  
    const handlePortfolioClick = () => {
      navigate('/head');
    };

    return (
        <header>
            <nav>
            <i className="bi bi-list" style={{ fontSize: "2rem", cursor: "pointer" }}></i>
            <img src="/logo.png" alt="ICA Logo" className="img-fluid" style={{ maxWidth: '25%' }} />
            <i className="bi bi-person" style={{ fontSize: "2rem", color: "gray" }}></i>
            </nav>
        </header>
     );
};

export default Head;
